import React from 'react';
import ButtonMenu from './ButtonMenu.js'

function MainMenu() {
    return (
      <div className="MainMenu">
          <ButtonMenu name='Identifícate'></ButtonMenu>
          <ButtonMenu name='Mapa'></ButtonMenu>
          <ButtonMenu name='Configuración'></ButtonMenu>
      </div>
    );
  }

  export default MainMenu;
